pragma solidity ^0.4.24;

import "./EIP20Interface.sol";
import "./MoneyMarketBorrowerInterface.sol";

contract CompoundUser {
  address public moneyMarketAddress;
  address owner;

  constructor () public payable {
    owner = msg.sender;
  }

  function authorize(address assetAddress) public {
    require(owner == msg.sender);
    // authorize the transfer of erc20 tokens by compound and by factory contract
    EIP20Interface token = EIP20Interface(assetAddress);
    token.approve(moneyMarketAddress, 30);
    token.approve(msg.sender, 30);
  }

  function borrow(address assetAddress, uint requestedAmount) public {
    require(owner == msg.sender);

    compoundMoneyMarket().borrow(assetAddress, requestedAmount);
  }

  function supply(address assetAddress, uint requestedAmount) public {
    require(owner == msg.sender);

    compoundMoneyMarket().supply(assetAddress, requestedAmount);
  }

  function withdraw(address assetAddress, uint requestedAmount) public {
    require(owner == msg.sender);

    compoundMoneyMarket().withdraw(assetAddress, requestedAmount);
  }

  function repay(address assetAddress, uint amount) public {
    require(owner == msg.sender);
    compoundMoneyMarket().repayBorrow(assetAddress, amount);
  }


  function returnEth(address meatUserAddress) {
    // if borrow amount is 0 and supply amount is 0, selfdestruct
    selfdestruct(meatUserAddress);
  }

  function compoundMoneyMarket() returns (MoneyMarketBorrowerInterface) {
    return MoneyMarketBorrowerInterface(moneyMarketAddress);
  }
}
